import React from 'react';
import './header.scss';

function Name({name}) {
  return <h1 className='header-name'>{name}</h1>;
}

function Hr() {
  return <hr />;
}

function Links({links}) {
  // const listItems = links.map((link) =>
  //   <li className='header-links'><a href='#'>{link}</a></li>
  // );
  //
  // return (
  //   <ul className='header-links-container'>{listItems}</ul>
  // )

  return(
    <ul className='header-links-container'>
      {links.map((link) => (
        <li className='header-links'><a href='#'>{link}</a></li>
      ))}
    </ul>
  )
}

const links = ['Home', 'Resume', 'Portfolio', 'Media'];
function Header() {
  return (
    [<Name name='Stephanie Nathai-Cueter '/>,
     <Hr />,
     <Links links={links} />,
    ]
  )
}

export default Header;
